  const bgm=document.getElementById('bgm');
  const startBtn=document.getElementById('start');
  const overlay=document.getElementById('overlay');
  const sEl=document.getElementById('s'); const bEl=document.getElementById('b');
  let BEST=parseInt(localStorage.getItem('dodori_best')||'0',10); bEl.textContent=BEST;

  // ===== 러너/스폰 초기값 =====
  let running=false, over=false, score=0;
  let speed=250;
  let spawnMin=2.2, spawnMax=2.9;
  const obs=[]; let tSpawn=0, nextSpawn=2.3;

  // 낙하물
  const falls=[]; let tFall=0, nextFallTarget=3.2, fallChance=0.0;

  // ===== 플레이어 (싱글 점프 + 좌우 이동 + 빠른 낙하) =====
  const P={x:0,y:0,w:U,h:U,vy:0,g:1800,j:1080,grounded:false, vx:0};
  const move={left:false,right:false};
  const MOVE_SPEED = 420;
  const DESCENT_MULT = 1.65;

  function place(){P.w=P.h=Math.max(U, U*0.95); P.x=Math.floor(W*0.20); P.y=ground-P.h; P.vy=0; P.grounded=true; P.vx=0;}

  // ===== 사운드 =====
  let audioCtx=null, sfxGain=null;
  function initAudio(){ if(audioCtx) return; audioCtx=new (window.AudioContext||window.webkitAudioContext)(); sfxGain=audioCtx.createGain(); sfxGain.gain.value=0.5; sfxGain.connect(audioCtx.destination); }
  function tone(freq=760, dur=0.10, type='square', vol=0.5){
    if(!audioCtx) return;
    const t=audioCtx.currentTime, o=audioCtx.createOscillator(), g=audioCtx.createGain();
    o.type=type; o.frequency.setValueAtTime(freq,t); g.gain.value=vol; g.gain.exponentialRampToValueAtTime(0.0001,t+dur);
    o.connect(g); o.start(t); g.connect(sfxGain); o.stop(t+dur+0.02);
  }
  function sfxJump(){ tone(760,0.08,'square',0.5); }
  function sfxPass(){ tone(660,0.06,'triangle',0.4); setTimeout(()=>tone(880,0.07,'sine',0.5),60); }

  // ===== 입력 =====
  function jump(){ if(!running||over) return; if(P.grounded){P.vy=-P.j; P.grounded=false; sfxJump();} }
  addEventListener('keydown',e=>{
    if(e.code==='Space'||e.code==='Tab'||e.code==='ArrowUp'){e.preventDefault();jump();}
    if(e.code==='ArrowLeft') move.left=true;
    if(e.code==='ArrowRight') move.right=true;
  });
  addEventListener('keyup',e=>{
    if(e.code==='ArrowLeft') move.left=false;
    if(e.code==='ArrowRight') move.right=false;
  });
  addEventListener('pointerdown',e=>{ if(e.target===startBtn) return; jump(); });

  // ===== 장애물 생성기 =====
  function makeGroundObstacle(){
    const r=Math.random();
    let type='static';
    if(r<0.18) type='short';
    else if(r<0.36) type='tall';
    else if(r<0.60) type='bouncer';
    else if(r<0.84) type='slider';
    else type='spinner';

    const base=Math.max(U*1.0, U*1.1);
    let w=base, h=base, y=ground-base, spin=0, bobAmp=base*0.08, bobSpeed=0.9+Math.random()*0.6;
    if(type==='short'){ h=base*0.85; y=ground-h; }
    if(type==='tall'){ h=base*1.2; y=ground-h; }
    if(type==='spinner'){ w=base*1.4; h=base*0.5; y=ground-h-10; spin=(Math.random()<0.5?1:-1)*(0.9+Math.random()*1.3); }
    if(type==='slider'){ y=ground-h-(Math.random()*U*0.3); bobAmp=base*0.22; }
    if(type==='bouncer'){ bobAmp=base*0.14; }

    // 드물게 '러시' 장애물 플래그
    const rushProb = 0.03 + Math.min(0.07, score/15000*0.07); // 3% -> 최대 10%
    const rush = Math.random() < rushProb;
    const speedMul = rush ? (1.55 + Math.random()*0.35) : 1.0; // 빠른 속도
    return {kind:'ground', type, x:W+w, y, w, h, t:0, bobAmp, bobSpeed, rot:(Math.random()*0.06-0.03), spin, cleared:false, rush, speedMul};
  }

  function makeFallingObstacle(){
    const size = Math.max(U*0.9, U*1.0);
    const x = Math.random()*(W - size*1.2) + size*0.6;
    const vy = (H*0.35 + Math.random()*H*0.25);
    const rot = (Math.random()<0.5? -1:1) * (0.8 + Math.random()*1.4);
    return {kind:'fall', x, y:-size*1.2, w:size, h:size, vy, rot, t:0, cleared:false};
  }

  function A(a,b){return a.x<b.x+b.w&&a.x+a.w>b.x&&a.y<b.y+b.h&&a.y+a.h>b.y;}

  // ===== 배경 (맑은 하늘 + 초원 동산 + 구름 파라랙스) =====
  function bg(t){
    // 하늘
    const hue=(200 + Math.sin(t*0.1)*5)|0;
    const sky=ctx.createLinearGradient(0,0,0,H);
    sky.addColorStop(0,`hsl(${hue},90%,85%)`);
    sky.addColorStop(1,`hsl(${(hue+15)%360},95%,96%)`);
    ctx.fillStyle=sky; ctx.fillRect(0,0,W,H);

    // 구름 레이어
    ctx.globalAlpha = 0.8; drawClouds(t*12, H*0.22, 1.0);
    ctx.globalAlpha = 0.55; drawClouds(t*20, H*0.30, 0.7);
    ctx.globalAlpha = 1.0;

    // 멀리 언덕
    ctx.fillStyle = '#b9e6a6'; drawHills(12, H*0.70, 0.8);
    ctx.fillStyle = '#93d38b'; drawHills(0, H*0.76, 1.0);

    // 초원(지면)
    ctx.fillStyle = '#7fcf6b'; ctx.fillRect(0, ground, W, H-ground);

    // 들꽃 점
    const step = Math.max(18*DPR, U*0.3);
    for(let x=0; x<W; x+=step){
      const y = ground + (Math.sin((x+t*30)/140)*3 + 4)*DPR;
      ctx.fillStyle = (x/step)%3===0 ? '#fff9a8' : ((x/step)%3===1 ? '#ffd1e6':'#c0f0ff');
      ctx.fillRect(x, y, 2*DPR, 2*DPR);
    }
  }

  function drawClouds(offset, y, scale){
    const cw = Math.max(160*DPR, U*2.0)*scale;
    for(let x=-cw*2; x<W+cw*2; x+=cw*1.1){
      blob((x - (offset%cw)), y, cw*0.9, cw*0.5);
    }
  }
  function blob(x,y,w,h){
    ctx.beginPath();
    ctx.ellipse(x,y,w*0.45,h*0.45,0,0,Math.PI*2);
    ctx.ellipse(x-w*0.3,y+h*0.05,w*0.35,h*0.35,0,0,Math.PI*2);
    ctx.ellipse(x+w*0.3,y+h*0.05,w*0.35,h*0.35,0,0,Math.PI*2);
    ctx.fillStyle='rgba(255,255,255,0.95)'; ctx.fill();
  }
  function drawHills(offsetX, baseY, scale){
    const step = Math.max(220*DPR, U*2.4)*scale;
    ctx.beginPath(); ctx.moveTo(0,H);
    for(let x=-step*2; x<=W+step*2; x+=step){
      const h = Math.sin((x+offsetX)/step)*28*DPR + 34*DPR;
      ctx.lineTo(x+offsetX, baseY - h);
    }
    ctx.lineTo(W,H); ctx.closePath(); ctx.fill();
  }

  // ===== 난이도 업데이트 (0점부터 점진 ↑ / 낙하는 1000점↑) =====
  function updateDifficulty(){
    const d = Math.min(1.3, score / 11500);
    speed = 250 + d*260;           // 250 -> ~588
    spawnMin = 2.2 - d*1.0;        // 2.2 -> 1.2
    spawnMax = 2.9 - d*1.1;        // 2.9 -> 1.8

    if(score < 1000){
      nextFallTarget = 3.2;
      fallChance = 0.0;
    } else {
      const fd = Math.min(1.0, (score-1000)/9000);
      nextFallTarget = 2.8 - fd*1.2; // 2.8 -> 1.6
      fallChance = 0.20 + fd*0.40;   // 0.20 -> 0.60
    }
  }

  // ===== 루프 =====
  let last=0, raf=0;
  function loop(now){
    raf=requestAnimationFrame(loop);
    if(!last) last=now;
    const dt=Math.min(0.033,(now-last)/1000); last=now;
    if(!running) return;

    score+=dt*30; sEl.textContent=Math.floor(score);
    updateDifficulty();

    // 플레이어 이동
    P.vx = (move.left?-1:0) + (move.right?1:0);
    P.x += P.vx * 420 * dt;
    if(P.x < 0) P.x = 0;
    if(P.x + P.w > W) P.x = W - P.w;

    // 중력 (하강 가속)
    const isFalling = P.vy > 0;
    P.vy += P.g * (isFalling? 1.65: 1.0) * dt;
    P.y += P.vy * dt;
    if(P.y + P.h >= ground){ P.y = ground - P.h; P.vy = 0; P.grounded = true; }

    // 지상 장애물 스폰
    tSpawn += dt;
    if(tSpawn >= nextSpawn){ obs.push(makeGroundObstacle()); tSpawn = 0; nextSpawn = spawnMin + Math.random()*(spawnMax-spawnMin); }

    // 낙하물 스폰
    tFall += dt;
    if(tFall >= nextFallTarget){
      if(Math.random() < fallChance) falls.push(makeFallingObstacle());
      tFall = 0;
    }

    // 렌더
    bg(now/1000);

    // 플레이어
    const px=P.x, py=P.y;
    if(playerImg.naturalWidth) ctx.drawImage(playerImg,px,py,P.w,P.h); else {ctx.fillStyle='#fff';ctx.fillRect(px,py,P.w,P.h);}

    // 지상 장애물
    for(let i=obs.length-1;i>=0;i--){
      const o=obs[i];
      const mul = o.speedMul || 1.0;
      o.x -= (speed*mul)*dt; o.t += dt;
      let drawY=o.y, ang=o.rot;
      if(o.type==='bouncer'){ drawY = o.y + Math.sin(o.t*2.4*o.bobSpeed)*o.bobAmp; }
      else if(o.type==='slider'){ drawY = o.y + Math.sin(o.t*1.8*o.bobSpeed)*o.bobAmp; ang *= 0.5; }
      else if(o.type==='spinner'){ ang = o.t * o.spin; }
      ctx.save();
      const cx = o.x + o.w/2, cy = drawY + o.h/2;
      ctx.translate(cx, cy); ctx.rotate(ang);
      if(obsImg.naturalWidth) ctx.drawImage(obsImg,-o.w/2,-o.h/2,o.w,o.h); else {ctx.fillStyle='#9c6d3b'; ctx.fillRect(-o.w/2,-o.h/2,o.w,o.h);}
      // 러시 표시: 붉은 속도선
      if(o.rush){
        ctx.globalAlpha = 0.35;
        ctx.fillStyle = '#ff6b6b';
        ctx.fillRect(o.w*0.1, -o.h*0.05, o.w*0.55, o.h*0.10);
        ctx.globalAlpha = 1.0;
      }
      ctx.restore();
      const rect={x:o.x+o.w*0.18, y:drawY+o.h*0.15, w:o.w*0.64, h:o.h*0.70};
      if(A({x:P.x,y:P.y,w:P.w,h:P.h}, rect)){ gameOver(); }
      if(!o.cleared && (P.x > o.x + o.w)){ o.cleared = true; sfxPass(); }
      if(o.x + o.w < -40) obs.splice(i,1);
    }

    // 낙하 장애물
    for(let i=falls.length-1;i>=0;i--){
      const f=falls[i]; f.t += dt; f.y += (f.vy*dt);
      ctx.save();
      const cx=f.x + f.w/2, cy=f.y + f.h/2;
      ctx.translate(cx, cy); ctx.rotate(f.t * f.rot);
      if(fallImg.naturalWidth) ctx.drawImage(fallImg,-f.w/2,-f.h/2,f.w,f.h); else {ctx.fillStyle='#88a'; ctx.fillRect(-f.w/2,-f.h/2,f.w,f.h);}
      ctx.restore();
      const rect={x:f.x+f.w*0.15, y:f.y+f.h*0.15, w:f.w*0.70, h:f.h*0.70};
      if(A({x:P.x,y:P.y,w:P.w,h:P.h}, rect)){ gameOver(); }
      if(!f.cleared && (f.y > ground)){ f.cleared = true; sfxPass(); }
      if(f.y - f.h > H + 40) falls.splice(i,1);
    }
  }

  function gameOver(){
    over=true; running=false; cancelAnimationFrame(raf);
    overlay.style.display='flex'; startBtn.textContent='다시 시작';
    const sc=Math.floor(score); if(sc>BEST){ BEST=sc; localStorage.setItem('dodori_best',BEST); } bEl.textContent=BEST;
    try{bgm.pause();}catch{}
  }

  function start(){
    overlay.style.display='none';
    running=true; over=false; score=0; speed=250; tSpawn=0; nextSpawn=2.3; obs.length=0; falls.length=0; tFall=0; nextFallTarget=3.2; fallChance=0.0; place();
    bgm.volume=0.2;
    try{ bgm.currentTime=0; bgm.play().catch(()=>{}); }catch{}
    try{ if(!audioCtx) initAudio(); audioCtx && audioCtx.resume && audioCtx.resume(); }catch{}
    last=0; cancelAnimationFrame(raf); raf=requestAnimationFrame(loop);
  }
  startBtn.addEventListener('click',start);
  // 첫 프레임
  bg(0);
})();
</script>
</body>
</html>
